(71, 'Hollywood Medical Center', 'Consultant Physician', 'Providing specialized care in internal medicine. Conducting patient consultations, diagnostics, and treatment planning. Participated in clinical research projects and published papers on chronic disease management.', '2021-02-02', NULL, 1, 1, 160, 105, '2025-10-30 05:23:29', '2025-10-30 05:23:29'),
(72, 'Sunrise Hospital', 'Resident Doctor', 'Rotated through multiple departments including pediatrics, cardiology, and emergency care. Assisted senior physicians in surgeries and patient management.', '2018-06-05', '2021-02-02', 0, 2, 160, 105, '2025-10-30 05:24:28', '2025-10-30 05:24:28'),
(73, 'City General Hospital', 'Intern Doctor', 'Completed internship with hands-on experience in patient rounds, emergency care, and medical documentation. Developed foundational skills in patient communication and diagnosis.', '2017-01-01', '2017-12-01', 0, 3, 160, 105, '2025-10-30 05:25:20', '2025-10-30 05:25:20'),
