(75, 'Health & Strength Studio', 'Fitness Coach', 'Guided clients on strength training and cardio exercises. Assisted in rehabilitation exercises for injured clients. Conducted fitness assessments and created training schedules.', '2020-02-26', '2021-01-30', 0, 2, 162, 106, '2025-10-30 05:29:13', '2025-10-30 05:29:13'),
(76, 'Elite Fitness Center', 'Gym Instructor', 'Led group workout sessions, instructed proper form, and motivated clients to achieve their fitness goals. Organized workshops on nutrition and healthy lifestyle.', '2018-02-26', '2020-04-06', 0, 3, 162, 106, '2025-10-30 05:29:45', '2025-10-30 05:29:45'),
(77, 'Justice & Co. Law Firm', 'Senior Advocate', 'Represent clients in civil and corporate disputes. Draft legal documents, prepare case strategies, and handle courtroom proceedings. Provide legal consultation to business clients on compliance and contract matters.', '2020-01-01', NULL, 1, 1, 164, 107, '2025-10-30 05:33:56', '2025-10-30 05:33:56'),
(78, 'Legal Vision Associates', 'Associate Lawyer', 'Assisted senior counsels in litigation and arbitration cases. Conducted legal research, drafted petitions, and advised clients on property and family law.', '2017-12-15', '2020-05-30', 0, 2, 164, 107, '2025-10-30 05:34:26', '2025-10-30 05:34:26'),
(79, 'Supreme Court of Bangladesh', 'Legal Intern', 'Worked under senior lawyers observing court sessions, drafting legal notices, and learning practical litigation procedures.', '2015-02-25', '2016-12-12', 0, 3, 164, 107, '2025-10-30 05:34:55', '2025-10-30 05:34:55'),
(80, 'Self-employed', 'Freelance Visual Artist', 'Creating commissioned artworks, digital portraits, and illustrations for global clients. Exhibited work in online art galleries and collaborated with interior designers for wall art projects.', '2018-01-20', NULL, 1, 1, 158, 104, '2025-10-30 05:37:58', '2025-10-30 05:37:58'),
