(74, 'Bachelor of Medicine, Bachelor of Surgery (MBBS)', 'bachelor-of-medicine,-bachelor-of-surgery-(mbbs)', 'Completed MBBS degree with clinical rotations in internal medicine, surgery, pediatrics, and gynecology. Gained practical experience in patient care and diagnosis.', '2010-01-15', '2016-12-20', 1, 105, 160, '2025-10-30 05:26:24', '2025-10-30 05:26:24'),
