(77, 'Bachelor of Science in Sports Science', 'bachelor-of-science-in-sports-science', 'Studied human physiology, nutrition, exercise science, and sports psychology. Completed practical training in gym management and personal training techniques.', '2012-01-10', '2016-11-20', 1, 106, 162, '2025-10-30 05:30:13', '2025-10-30 05:30:13'),
(78, 'Higher Secondary School Certificate', 'higher-secondary-school-certificate', 'Specialized in Science (Biology, Chemistry, Physics) with focus on physical education and health sciences.', '2009-01-01', '2011-12-14', 2, 106, 162, '2025-10-30 05:30:38', '2025-10-30 05:30:38'),
