(80, 'Bachelor of Laws (LL.B)', 'bachelor-of-laws-(ll.b)', 'Graduated with honors in Civil and Criminal Law. Completed coursework in Constitutional Law, Contract Law, and Legal Drafting.', '2010-01-21', '2014-11-20', 1, 107, 164, '2025-10-30 05:32:37', '2025-10-30 05:32:37'),
