(185, 'Heart & Cardiology Care', 'heart-&-cardiology-care', '1760250052.png', '<p>Discover exceptional cardiac care with our highly qualified cardiologists dedicated to your hearts health. From preventive screenings and ECG evaluations to complex cardiac consultations, we provide complete solutions for heart-related issues. Our modern facilities ensure accurate diagnosis and treatment using advanced technology. Whether its high blood pressure, chest pain, or long-term cardiac management  your heart is safe with us.</p>', 1, 0, 160, 104, 105, NULL, NULL, '2025-10-12 00:20:54', '2025-10-12 00:22:12'),
(186, 'Child Health & Pediatric Care', 'child-health-&-pediatric-care', '1760250442.png', '<p>Our pediatric department is designed with childrens comfort and safety in mind. From newborn care and vaccinations to growth tracking and nutrition guidance, we ensure every child receives personalized attention. Our doctors focus on preventive care, development monitoring, and early diagnosis to support healthy growth at every stage of childhood.</p>', 2, 0, 160, 105, 105, NULL, NULL, '2025-10-12 00:27:22', '2025-10-12 00:27:22'),
(187, 'Gynecology Services', 'gynecology-services', '1760250758.png', '<p>We understand that every womans health journey is unique. Our gynecology and obstetrics specialists offer complete care  from menstrual and hormonal concerns to pregnancy and postpartum recovery. We prioritize comfort, privacy, and trust, ensuring that each woman receives individualized treatment for her physical and emotional well-being.</p>', 3, 0, 160, 106, 105, NULL, NULL, '2025-10-12 00:32:39', '2025-10-12 00:32:39'),
(188, 'Mental Health Therapy', 'mental-health-therapy', '1760251118.png', '<p>Mental wellness is not a luxury  its a necessity. Our psychiatric and counseling experts are here to help you manage anxiety, depression, stress, and emotional challenges with care and confidentiality. We combine evidence-based therapy with compassionate support to help you regain balance, confidence, and peace of mind.</p>', 4, 0, 160, 107, 105, NULL, NULL, '2025-10-12 00:38:38', '2025-10-12 00:38:38'),
(189, 'Pediatric Consultation', 'pediatric-consultation', '1760251365.png', '<p>Your heart deserves dedicated attention and advanced medical expertise. Our cardiovascular consultation service focuses on prevention, diagnosis, and long-term management of heart-related conditions. From hypertension and cholesterol management to ECG interpretation and lifestyle guidance, our cardiologists offer complete heart care in a calm and professional environment. We blend compassion with technology to ensure your heart stays healthy at every beat.</p>', 6, 0, 160, 105, 105, NULL, NULL, '2025-10-12 00:42:45', '2025-10-12 00:43:25'),
(190, 'Cardiovascular Consultation', 'cardiovascular-consultation', '1760251677.png', '<p>Your heart deserves dedicated attention and advanced medical expertise. Our cardiovascular consultation service focuses on prevention, diagnosis, and long-term management of heart-related conditions. From hypertension and cholesterol management to ECG interpretation and lifestyle guidance, our cardiologists offer complete heart care in a calm and professional environment. We blend compassion with technology to ensure your heart stays healthy at every beat.</p>', 6, 0, 160, 104, 105, NULL, NULL, '2025-10-12 00:47:57', '2025-10-12 00:47:57'),
