(197, 'Criminal Defense Case', 'criminal-defense-case', '1760530720.png', '<p>When your freedom and reputation are on the line, our Criminal Defense Case service gives you the strong protection you deserve. We analyze every detail, challenge weak evidence, and fight fearlessly to ensure your rights and your future are safeguarded.</p>', 1, 1, 164, 112, 107, NULL, NULL, '2025-10-15 06:18:40', '2025-10-18 00:52:17'),
(198, 'Car Accident Case', 'car-accident-case', '1760530733.png', '<p>If youve been injured or suffered losses in a car accident, our Car Accident Case service helps you claim compensation for medical bills, property damage, and emotional distress. We handle everything from negotiation to court representation.</p>', 2, 1, 164, 113, 107, NULL, NULL, '2025-10-15 06:18:53', '2025-10-18 00:53:14'),
(199, 'Family & Personal Dispute Case', 'family-&-personal-dispute-case', '1760530751.png', '<p>Personal and family conflicts require sensitivity and care. Our Family &amp; Personal Dispute Case service supports you through divorce, custody, inheritance, and relationship matters with confidentiality, compassion, and expert legal advice.</p>', 3, 1, 164, 114, 107, NULL, NULL, '2025-10-15 06:19:11', '2025-10-18 00:52:55'),
(200, 'Civil Litigation Case', 'civil-litigation-case', '1760530775.png', '<p>Our Civil Litigation Case service helps you resolve disputes with professionalism and precision. From property conflicts to contract breaches, we represent you with strategy and fairnessaiming for swift and just resolutions in every case.</p>', 4, 1, 164, 112, 107, NULL, NULL, '2025-10-15 06:19:35', '2025-10-18 00:52:36'),
(201, 'Criminal Investigation & Trial Case', 'criminal-investigation-&-trial-case', '1760530792.png', '<p>If youve been injured or suffered losses in a car accident, our Car Accident Case service helps you claim compensation for medical bills, property damage, and emotional distress. We handle everything from negotiation to court representation.</p>', 5, 1, 164, 113, 107, NULL, NULL, '2025-10-15 06:19:52', '2025-10-18 00:54:04'),
(202, 'Financial Fraud & Recovery Case', 'financial-fraud-&-recovery-case', '1760530894.png', '<p>Protect your money and restore stability with our Financial Fraud &amp; Recovery Case service. We assist in cases of financial deception, loan disputes, and monetary losses with precise legal action and dedicated client support.</p>', 6, 1, 164, 115, 107, NULL, NULL, '2025-10-15 06:21:34', '2025-10-18 00:53:47'),
