(210, 'Strength & Transformation', 'strength-&-transformation', '1761987884.png', '<p>Your transformation starts here. Our <strong>personal training program</strong> is built to help you push beyond your limits and discover the strongest version of yourself. Whether youre new to fitness or aiming to take your training to the next level, our certified personal trainers are here to guide, motivate, and support you every step of the way.</p><p>Each program is fully customized  from workout routines to nutrition guidance  designed to match your goals, body type, and lifestyle. We focus on building strength, improving posture, increasing endurance, and helping you achieve visible, long-lasting results.</p><p>With one-on-one attention, proper technique correction, and progress tracking, youll not only transform your body but also develop a stronger mindset. Its not just about lifting weights  its about lifting your confidence, your energy, and your life.</p><p>Start your journey today and feel the difference as you <strong>transform from within  stronger, fitter, and unstoppable.</strong></p>', 1, 0, 162, 121, 106, NULL, NULL, '2025-11-01 02:55:41', '2025-11-01 03:18:31'),
(211, ' ', '-', '1761988515.png', '<p>   .             .                          .</p><p>    -       -       .                  .</p><p>                .       -        .</p><p>         -     .</p>', 1, 0, 163, 122, 106, NULL, NULL, '2025-11-01 02:56:01', '2025-11-01 03:18:41'),
(212, 'Eat Right, Stay Fit', 'eat-right,-stay-fit', '1761987856.png', '<p>True fitness starts with the food you eat. At our gym, we believe that nutrition is the foundation of every successful fitness journey. Thats why our certified nutritionists and diet planners create personalized meal plans tailored to your goals  whether its weight loss, muscle gain, or simply maintaining a healthy lifestyle.</p><p>We dont believe in restrictive diets or one-size-fits-all plans. Instead, we help you understand your bodys unique needs and build sustainable eating habits that fuel your workouts and improve your overall health. Each plan includes balanced portions of proteins, carbs, and healthy fats  ensuring you stay energized and satisfied throughout the day.</p><p>From tracking your daily calories to helping you make smarter food choices, our experts guide you every step of the way. Combine your workouts with the right nutrition, and youll see faster, more lasting results  inside and out.</p><p>Because when you <strong>eat right</strong>, you dont just get fit  <strong>you stay fit for life.</strong></p>', 2, 0, 162, 123, 106, NULL, NULL, '2025-11-01 02:56:23', '2025-11-01 03:17:51'),
(213, '     ', '-----', '1761988494.png', '<p>      .              .                            .</p><p>          .                .                 .</p><p>                 .              .</p><p>              .</p>', 2, 0, 163, 124, 106, NULL, NULL, '2025-11-01 02:56:36', '2025-11-01 03:18:01'),
(214, 'Energy in Every Move', 'energy-in-every-move', '1761987848.png', '<p>Experience the power of group fitness with our high-energy classes that keep you motivated, moving, and full of life! At our gym, every session is designed to push your limits in a fun, supportive environment. Whether you love the rhythm of Zumba, the intensity of HIIT, or the challenge of strength circuits  our classes make fitness exciting and social.</p><p>Each class is led by certified trainers who bring passion and expertise to every workout. They guide you through safe, effective routines that improve endurance, coordination, and overall strength  all while keeping the energy levels high.</p><p>No matter your fitness level, youll find a class that fits you perfectly. Our group workouts are not just about sweating  theyre about connecting, laughing, and achieving goals together. Because when you move with others, you move stronger.</p>', 3, 0, 162, 125, 106, NULL, NULL, '2025-11-01 02:56:58', '2025-11-01 03:16:49'),
(215, '   ', '---', '1761988471.png', '<p>              !              .         HIIT            .</p><p>          .              -        .</p><p>          .               .       .</p>', 3, 0, 163, 126, 106, NULL, NULL, '2025-11-01 02:57:10', '2025-11-01 03:16:58'),
(216, 'Balance Mind and Body', 'balance-mind-and-body', '1761988251.png', '<p>In todays fast-paced world, maintaining balance between the mind and body is essential. Our Yoga &amp; Wellness programs are designed to help you slow down, breathe deeply, and reconnect with yourself. Whether youre a beginner or an experienced yogi, our sessions focus on improving flexibility, posture, and mindfulness through guided poses and meditative breathing.</p><p>We offer a range of yoga styles  from relaxing Hatha and Vinyasa flows to energizing Power Yoga  ensuring every member finds the perfect rhythm for their goals. Alongside yoga, our wellness practices include meditation, stretching, and relaxation techniques that reduce stress, boost energy, and improve overall well-being.</p><p>Here, fitness is not just about muscle  its about harmony. Join our yoga and wellness community to strengthen your body, calm your mind, and create a lasting sense of inner peace.</p>', 4, 0, 162, 127, 106, NULL, NULL, '2025-11-01 02:57:25', '2025-11-01 03:15:49'),
(217, '   ', '---', '1761988440.png', '<p>            .             .                      .</p><p>      -          -         .                  .</p><p>           .              .</p>', 4, 0, 163, 128, 106, NULL, NULL, '2025-11-01 02:57:37', '2025-11-01 03:16:21'),
(218, 'Build Strength, Sculpt Confidence', 'build-strength,-sculpt-confidence', '1761988999.png', '<p>Our bodybuilding and muscle gain programs are designed for those who want to build serious strength and achieve a powerful physique. With personalized workout routines, progressive overload training, and expert supervision, we help you grow muscle safely and effectively. Combine your workouts with the right nutrition plan to see visible results in weeks.</p>', 5, 0, 162, 127, 106, NULL, NULL, '2025-11-01 03:23:19', '2025-11-01 03:23:19'),
(219, '   ', '---', '1761989033.png', '<p>   .             .                          .</p><p>    -       -       .                  .</p><p>                .       -        .</p><p>         -     .</p>', 5, 0, 163, 128, 106, NULL, NULL, '2025-11-01 03:23:53', '2025-11-01 03:23:53'),
(220, 'Move Better, Live Stronger', 'move-better,-live-stronger', '1761989069.png', '<p>Our functional training sessions focus on exercises that improve your real-life movements  making you stronger, more flexible, and injury-free. With dynamic workouts that enhance balance, coordination, and mobility, youll perform better both in and out of the gym. Perfect for athletes, beginners, and everyday movers alike.</p><p>Fitness isnt just physical  its mental too. Our mental fitness and motivation coaching programs help you stay consistent, overcome self-doubt, and build discipline. Learn to set achievable goals, visualize success, and maintain focus through guided motivation and mindset sessions.</p>', 6, 0, 162, 121, 106, NULL, NULL, '2025-11-01 03:24:29', '2025-11-01 03:24:29'),
(221, '    ', '----', '1761989123.png', '<p>                 .                .         .</p><p>       .                .                 .</p>', 6, 0, 163, 122, 106, NULL, NULL, '2025-11-01 03:25:23', '2025-11-01 03:25:23');
