(144, '1760011267.png', NULL, 'Cardiology', 'cardiology', '<p>Experience world-class heart care with our <strong>Expert Cardiology Consultation</strong> service. Our qualified cardiologists specialize in diagnosing and treating a wide range of cardiovascular conditions, including hypertension, arrhythmia, and coronary artery disease. Whether you need preventive advice or ongoing heart management, our specialists ensure precise evaluation and effective treatment using state-of-the-art equipment.<br />\r\nYou can book your session online or visit our clinic for a thorough examination and tailored care plan that fits your lifestyle and medical history. Your heart deserves the best  lets keep it healthy together.</p>', 1, 1, 1, 160, 105, NULL, NULL, '2025-10-09 06:01:07', '2025-10-11 06:02:53'),
(145, '1760011374.png', NULL, 'Mental Health', 'mental-health', '<p>Your emotional well-being is as important as your physical health. Our <strong>Comprehensive Mental Health Counseling</strong> service offers a safe and supportive space to help you navigate lifes challenges. Our certified therapists specialize in a variety of therapeutic techniques, including Cognitive Behavioral Therapy (CBT) and mindfulness-based practices. Whether youre dealing with anxiety, depression, trauma, or burnout, were here to help you find clarity, balance, and resilience.<br />\r\nSessions are available both online and in-person, ensuring comfort and confidentiality every step of the way. Take the first step toward a calmer, more confident you  because your mind matters.</p>', 2, 1, 1, 160, 105, NULL, NULL, '2025-10-09 06:02:54', '2025-10-11 06:03:21'),
(146, '1760011391.png', NULL, 'Diabetes', 'diabetes', '<p>Take control of your health with our <strong>Comprehensive Diabetes Care &amp; Management</strong> service. Our expert endocrinologists and diabetes specialists work closely with you to develop a personalized treatment plan that fits your lifestyle. From blood glucose monitoring and medication adjustments to nutrition guidance and physical activity plans  we ensure every aspect of your care is covered.<br />\r\nWhether you are newly diagnosed or managing diabetes for years, our goal is to help you maintain stable blood sugar levels and prevent long-term complications. With continuous support and regular check-ups, you can enjoy a healthier, more energetic life.</p>', 3, 1, 1, 160, 105, NULL, NULL, '2025-10-09 06:03:11', '2025-10-11 06:03:42'),
(147, '1760011408.png', NULL, 'Arthritis', 'arthritis', '<p>Regain your comfort and mobility with our <strong>Advanced Arthritis Treatment &amp; Pain Relief</strong> service. Our experienced specialists provide tailored care to reduce joint inflammation, improve flexibility, and restore your active lifestyle. Using a combination of medication management, physiotherapy, and advanced treatment options, we focus on relieving pain while strengthening your joints.<br />\r\nWhether youre dealing with osteoarthritis, rheumatoid arthritis, or chronic joint stiffness, our team ensures you receive compassionate, evidence-based care. You can book online or visit our clinic for personalized guidance to live pain-free and move freely again.</p>', 4, 1, 1, 160, 105, NULL, NULL, '2025-10-09 06:03:28', '2025-10-11 06:04:04'),
(148, '1760011426.png', NULL, 'HIV/AIDS', 'hivaids', '<p>Our <strong>Comprehensive HIV/AIDS Care &amp; Counseling</strong> service is dedicated to providing compassionate, confidential, and science-based care for individuals living with or at risk of HIV. We offer expert consultation, ongoing antiretroviral therapy (ART) management, and personalized health plans to strengthen your immune system and improve your quality of life.<br />\r\nBeyond medical treatment, we provide emotional and psychological support to help you navigate the challenges of living with HIV with confidence and dignity. Whether you prefer an online session or a private in-clinic visit, our team ensures your comfort, confidentiality, and continuous care every step of the way.</p>', 5, 1, 1, 160, 105, NULL, NULL, '2025-10-09 06:03:46', '2025-10-11 06:04:33'),
(149, '1760011441.png', NULL, 'Asthma', 'asthma', '<p>Breathe easier with our <strong>Comprehensive Asthma Care &amp; Management</strong> service. Our experienced pulmonologists provide thorough assessments to understand your asthma triggers and severity. We create personalized care plans, including medication guidance, inhaler techniques, and lifestyle recommendations to reduce flare-ups and improve lung function.<br />\r\nWhether youre newly diagnosed or managing chronic asthma, our team ensures you receive continuous support, education, and follow-up care. Available both online and in-person, our service is designed to help you lead an active, healthy, and symptom-free life.</p>', 6, 1, 1, 160, 105, NULL, NULL, '2025-10-09 06:04:01', '2025-10-11 06:04:52'),
