(156, '1760442071.png', 'fas fa-gavel', 'Fitness Body', 'fitness-body', '<p>Achieve the ultimate <strong>full-body transformation</strong> with our <strong>Fitness Body</strong> program, designed for anyone looking to <strong>tone, sculpt, and strengthen their entire physique</strong>. This program is perfect for beginners who want to kickstart their fitness journey, as well as for experienced athletes aiming for complete body conditioning. Fitness Body focuses on building a balanced and strong physique while improving overall health and performance.</p>\n<p>The program combines <strong>strength training, functional exercises, and targeted conditioning routines</strong> to address every major muscle group. Each session is carefully structured to enhance <strong>muscle tone, cardiovascular endurance, and flexibility</strong>, ensuring that your body not only looks great but also functions optimally. By following progressive workouts tailored to your fitness level, you will see <strong>noticeable improvements in strength, posture, and overall physical performance</strong>.</p>\n<p>Our expert trainers guide you through every movement, emphasizing proper technique, safety, and gradual progression. This ensures you maximize results while minimizing the risk of injury. The Fitness Body program also incorporates <strong>core strengthening, mobility exercises, and high-intensity interval training (HIIT)</strong> to accelerate fat loss, boost metabolism, and improve stamina.</p>\n<p>Nutrition and recovery are integral parts of Fitness Body. Personalized meal plans, hydration guidance, and recovery strategies ensure your body receives the right fuel for <strong>muscle growth, energy, and repair</strong>. This holistic approach ensures that every effort you put into training is complemented by the right lifestyle habits, leading to sustainable, long-term results.</p>\n<p>Fitness Body is more than just a workout routineits a <strong>comprehensive fitness experience</strong>. Participants not only gain a toned and strong physique but also experience enhanced confidence, mental clarity, and improved energy levels. Whether your goal is <strong>fat loss, muscle definition, overall fitness, or lifestyle transformation</strong>, this program adapts to your needs and keeps you motivated throughout your journey.</p>\n<p>Join <strong>Fitness Body</strong> today and embark on a journey toward a <strong>healthier, stronger, and more balanced version of yourself</strong>. With structured workouts, expert guidance, and a focus on total body conditioning, this program is the ultimate solution for anyone serious about achieving lasting fitness results. Transform your body, elevate your strength, and unlock your full potential with Fitness Body.</p>', 1, 1, 1, 162, 106, NULL, NULL, '2025-10-14 05:41:11', '2025-10-19 05:33:00'),
(157, '1760442083.png', 'fas fa-gavel', ' ', '-', '<p>      \" \"           .                         .</p><p>                .                .           \" \"        .                             .</p><p>     \" \"         .                    .                 .</p><p> \" \"            .                 .                          .</p><p> \" \"          .         .                           .</p><p>  \" \"                  .              .</p>', 1, 1, 1, 163, 106, NULL, NULL, '2025-10-14 05:41:23', '2025-10-19 05:38:16'),
(158, '1760442106.png', 'fas fa-pray', 'Fitness Yoga', 'fitness-yoga', '<p>Discover the perfect harmony of <strong>mind and body</strong> with our <strong>Fitness Yoga</strong> program. Designed for individuals of all fitness levels, this program focuses on <strong>enhancing flexibility, improving balance, reducing stress, and boosting overall wellness</strong>. Whether you are a beginner seeking gentle guidance or an experienced practitioner looking to deepen your practice, Fitness Yoga provides a structured and supportive environment to achieve your health and fitness goals.</p>\n<p>Our program combines traditional yoga techniques with modern fitness principles to create a <strong>holistic approach to physical and mental well-being</strong>. Each session focuses on <strong>strengthening core muscles, increasing joint mobility, and improving posture</strong>, while incorporating breathing exercises and mindfulness practices to promote relaxation and mental clarity. This approach not only helps you develop physical strength but also enhances focus, concentration, and inner calm.</p>\n<p>Fitness Yoga is ideal for anyone looking to <strong>relieve stress, prevent injuries, and improve overall body function</strong>. By integrating dynamic stretches, controlled poses, and mindful movement sequences, our program ensures a full-body workout that is both challenging and rejuvenating. Our expert instructors provide personalized guidance, helping you maintain correct alignment, progress safely, and experience the maximum benefits from each session.</p>\n<p>Beyond physical benefits, Fitness Yoga emphasizes <strong>mental resilience and emotional balance</strong>. The combination of mindful breathing, meditation, and intentional movement helps reduce anxiety, increase energy levels, and foster a positive mindset. Participants often notice improvements in sleep quality, mood stability, and overall life satisfaction.</p>\n<p>Fitness Yoga also complements other fitness routines such as strength training, cardio, or endurance workouts by <strong>enhancing flexibility, aiding recovery, and preventing injuries</strong>. The program is suitable for all ages and fitness levels, making it a versatile addition to any wellness journey.</p>\n<p>Join <strong>Fitness Yoga</strong> today and experience a transformative program that nurtures both <strong>body and mind</strong>. Achieve better posture, stronger muscles, enhanced flexibility, and mental clarity while embracing a healthier, more balanced lifestyle. Fitness Yoga is not just an exercise routine  its a path to <strong>holistic wellness, inner peace, and sustainable fitness</strong>.</p>', 2, 1, 1, 162, 106, NULL, NULL, '2025-10-14 05:41:46', '2025-10-19 05:32:27'),
(159, '1760442116.png', 'fas fa-pray', ' ', '-', '<p>      \" \"           .                         .</p><p>                .                .           \" \"        .                             .</p><p>     \" \"         .                    .                 .</p><p> \" \"            .                 .                          .</p><p> \" \"          .         .                           .</p><p>  \" \"                  .              .</p>', 2, 1, 1, 163, 106, NULL, NULL, '2025-10-14 05:41:56', '2025-10-19 05:37:35'),
(160, '1760442131.png', 'fas fa-dumbbell', 'Fitness muscle', 'fitness-muscle', '<p>Take your physique to the next level with our <strong>Fitness Muscle</strong> program, specially designed for those who want to <strong>gain muscle, sculpt their body, and maximize strength</strong>. This program is ideal for beginners eager to start their muscle-building journey as well as experienced fitness enthusiasts looking to push their limits and achieve peak performance.</p>\n<p>Our approach combines <strong>science-backed strength training, resistance exercises, and functional movements</strong> that target every major muscle group. Each session is carefully crafted to promote <strong>muscle growth, improve endurance, and enhance overall body composition</strong>. By focusing on proper form, controlled progression, and intensity, Fitness Muscle ensures that your efforts translate into real, measurable results. Whether your goal is <strong>bigger arms, stronger legs, a defined chest, or a full-body transformation</strong>, this program provides the tools and guidance to get there efficiently.</p>\n<p>Beyond just building muscles, Fitness Muscle emphasizes <strong>balanced fitness, injury prevention, and sustainable growth</strong>. Our expert trainers provide continuous feedback and motivation, helping you maintain consistency while gradually increasing your strength and stamina. Nutritional guidance and personalized meal plans accompany the workouts, ensuring your muscles get the right fuel for <strong>optimal recovery and growth</strong>.</p>\n<p>Fitness Muscle is more than just lifting weights  its about <strong>transforming your lifestyle</strong>. The program promotes mental resilience, focus, and discipline, helping you adopt habits that support long-term health and fitness. By combining <strong>progressive resistance training, cardio elements, and flexibility exercises</strong>, we ensure your body not only gains muscle but also improves coordination, agility, and overall athletic performance.</p>\n<p>With Fitness Muscle, you can expect visible results, enhanced energy levels, and a boost in confidence. Each workout is designed to challenge your limits, track your progress, and celebrate your achievements. Whether your goal is to <strong>bulk up, define your muscles, or increase overall strength</strong>, this program adapts to your individual needs and keeps you motivated throughout the journey.</p>\n<p>Join <strong>Fitness Muscle</strong> today and experience the ultimate muscle-building program that combines <strong>strength, endurance, nutrition, and lifestyle guidance</strong>. Transform your body, amplify your power, and achieve the strong, defined physique youve always dreamed of.</p>', 3, 1, 1, 162, 106, NULL, NULL, '2025-10-14 05:42:11', '2025-10-19 05:31:48'),
(161, '1760442142.png', 'fas fa-dumbbell', ' ', '-', '<p>      \" \"           .                         .</p><p>                .                .           \" \"        .                             .</p><p>     \" \"         .                    .                 .</p><p><br /></p><p> \" \"            .                 .                          .</p><p> \" \"          .         .                           .</p><p>  \" \"                  .              .</p>', 3, 1, 1, 163, 106, NULL, NULL, '2025-10-14 05:42:22', '2025-10-19 05:36:09'),
(162, '1760442161.png', 'fas fa-bolt', 'Fitness Power', 'fitness-power', '<p>Are you ready to take your fitness journey to the next level? Our <strong>Fitness Power</strong> program is meticulously designed for individuals who are serious about transforming their body and boosting their overall performance. Whether you are a beginner looking to build a strong foundation or an experienced athlete striving for peak strength, this program offers a complete solution tailored to your needs.</p>\n<p>With a focus on <strong>muscle development, strength training, and endurance enhancement</strong>, Fitness Power combines scientifically-backed workout routines with expert coaching to help you achieve tangible results. Each session is structured to challenge your body while ensuring proper form and safety, making it suitable for all fitness levels. Our program includes a mix of <strong>resistance training, functional exercises, and high-intensity workouts</strong> that target every major muscle group. This holistic approach not only helps in building strength but also improves flexibility, balance, and overall physical performance.</p>\n<p>Beyond physical strength, Fitness Power emphasizes <strong>mental resilience and consistency</strong>. Our trainers guide you through every step of your journey, motivating you to push past limits and adopt a disciplined fitness lifestyle. Nutrition advice and personalized meal plans complement your workouts, ensuring that your body gets the fuel it needs for optimal growth and recovery. Whether your goal is <strong>increased energy, weight management, or peak athletic performance</strong>, this program is designed to adapt to your unique objectives.</p>\n<p>Fitness Power is not just a workout program; its a <strong>comprehensive fitness experience</strong>. From structured weekly routines to progress tracking and personalized coaching, we ensure you stay motivated and achieve measurable results. Our approach encourages long-term commitment to health and fitness, helping you build habits that last a lifetime. By joining Fitness Power, youre not just training your body  youre transforming your lifestyle, boosting confidence, and enhancing your overall well-being.</p>\n<p>Take the first step toward a stronger, fitter, and more powerful version of yourself. With Fitness Power, your goals are within reach, and your potential is limitless. Join us today and experience the ultimate blend of <strong>strength, endurance, and fitness mastery</strong>.</p>', 4, 1, 1, 162, 106, NULL, NULL, '2025-10-14 05:42:41', '2025-10-19 05:31:00'),
