(164, '1760526674.png', NULL, 'Car Accident Case', 'car-accident-case', '<p>A car accident can change your life in an instantbringing physical pain, emotional distress, and financial challenges. Our <strong>Car Accident Case</strong> service is here to help you recover what youve lost and secure the justice you deserve. Whether youve been injured due to reckless driving, distracted driving, drunk driving, or negligence, our skilled legal team will guide you through every step of the process with care, professionalism, and dedication.</p><p>We start by investigating your accident in detailcollecting evidence, reviewing police reports, consulting with medical experts, and reconstructing events to build a strong claim on your behalf. Our goal is to ensure that the responsible party is held accountable and that you receive fair compensation for your medical expenses, property damage, lost income, and pain and suffering.</p><p>We know how stressful and confusing insurance negotiations can be, which is why we handle all communication and legal proceedings on your behalfallowing you to focus on healing. Whether your case is resolved through settlement or taken to court, we fight relentlessly to protect your rights and achieve the maximum possible outcome.</p><p>With our <strong>Car Accident Case</strong> service, youre not just getting a lawyeryoure getting a trusted advocate who stands by you from start to finish, ensuring that your recovery journey is supported by strength, compassion, and justice.</p>', 1, 1, 1, 164, 107, NULL, NULL, '2025-10-15 05:11:15', '2025-10-18 00:33:17'),
(165, '1760526687.png', NULL, '  ', '--', '<div>             .               .                             .</div><div><br /></div><div>     -                .                  .</div><div><br /></div><div>                  -      .                  .                              .</div>', 1, 1, 1, 165, 107, NULL, NULL, '2025-10-15 05:11:27', '2025-10-18 00:45:35'),
(166, '1760526702.png', NULL, 'Criminal Defense Case', 'criminal-defense-case', '<p>When your freedom, reputation, and future are on the line, you deserve a defense team that stands firm, fights smart, and never backs down. Our <strong>Criminal Defense Case</strong> service is dedicated to protecting your rights and ensuring that you receive fair treatment throughout every step of the legal process. Whether youre facing charges for theft, fraud, assault, drug offenses, or other criminal allegations, our experienced defense attorneys bring skill, strategy, and determination to your side.</p><p>We begin by thoroughly investigating your caseexamining evidence, interviewing witnesses, and identifying any procedural errors or rights violations that could strengthen your defense. Our approach is not just about responding to accusations, but about building a powerful, proactive case designed to achieve the best possible outcomebe it case dismissal, charge reduction, or acquittal.</p><p>At every stage, we provide clear communication, honest guidance, and steadfast support. We understand the stress and uncertainty that come with criminal charges, which is why we prioritize both your legal and emotional well-being. Our mission is to defend you vigorously, preserve your dignity, and help you move forward with confidence.</p><p>With our <strong>Criminal Defense Case</strong> service, you gain more than just legal representationyou gain a committed advocate who believes in your right to justice and will fight tirelessly to protect it.</p>', 2, 1, 1, 164, 107, NULL, NULL, '2025-10-15 05:11:42', '2025-10-18 00:32:56'),
(167, '1760526712.png', NULL, '  ', '--', '<p>                .                   .                             .</p><p>     -               .                     -          .</p><p>         .              .            .</p><p>                        .</p>', 2, 1, 1, 165, 107, NULL, NULL, '2025-10-15 05:11:52', '2025-10-18 00:44:41'),
(168, '1760526729.png', NULL, 'Family Biolance Case', 'family-biolance-case', '<p>Family matters are deeply personal, and when legal issues arise, they require not just legal expertise but also compassion and understanding. Our <strong>Family Bivalence Case</strong> service is designed to help you navigate sensitive family-related disputes with care, respect, and professionalism. Whether youre dealing with divorce, child custody, inheritance issues, spousal support, or property division, our experienced legal team provides the guidance and representation you need to protect your rights and secure a fair outcome.</p><p>We approach every case with empathy, recognizing the emotional and financial challenges involved in family conflicts. Our goal is to resolve disputes peacefully whenever possiblethrough negotiation, mediation, or mutual agreementbut we are also prepared to stand firmly by your side in court when litigation becomes necessary.</p><p>From the very first consultation, we focus on understanding your unique situation, listening to your concerns, and developing a personalized strategy that reflects your best interests and long-term well-being. With our <strong>Family Bivalence Case</strong> service, you can rely on us to handle your case with sensitivity, discretion, and unwavering dedicationhelping you move forward toward a more stable and positive future.</p><p>Masud, just to confirm  did you mean <strong>Family Balance Case</strong> or <strong>Family Violence Case</strong> instead of <em>Family Biolance Case</em>?<br />\nThe word <em>Biolance</em> doesnt match any known legal term, so I want to be sure before refining this further.</p>', 3, 1, 1, 164, 107, NULL, NULL, '2025-10-15 05:12:09', '2025-10-18 00:32:36'),
(169, '1760526739.png', NULL, '  ', '--', '<div>                  .                .                               .</div><div><br /></div><div>             .         -         -             .</div><div><br /></div><div>                    .                           .</div><div><br /></div><div>   -   \"  \"  \"  \"   \"  \"</div><div><br /></div><div> \" \"               .</div>', 3, 1, 1, 165, 107, NULL, NULL, '2025-10-15 05:12:19', '2025-10-18 00:43:00'),
(170, '1760526754.png', NULL, 'Civil Litigation Case', 'civil-litigation-case', '<p>Facing a legal dispute can be stressful, uncertain, and time-consumingbut with our <strong>Civil Litigation Case</strong> service, you dont have to face it alone. Our dedicated legal team provides comprehensive support for individuals and businesses involved in civil conflicts, including contract breaches, real estate disputes, partnership disagreements, consumer claims, and more. We understand that every case is unique, which is why we begin by carefully analyzing your situation, gathering all relevant evidence, and developing a clear, result-driven legal strategy tailored to your goals.</p><p>Our experienced attorneys represent clients at every stage of the litigation processfrom filing or responding to a lawsuit, negotiating settlements, to representing you confidently in court. We prioritize transparent communication, keeping you informed about every development and ensuring you understand your legal options. Our mission is not just to win cases, but to secure fair resolutions that protect your interests, reputation, and peace of mind.</p><p>With a commitment to professionalism, integrity, and attention to detail, our team works tirelessly to achieve the best possible outcome for you. Whether you are defending your rights or pursuing justice, trust our <strong>Civil Litigation Case</strong> service to guide you through the legal system with confidence and clarity.</p>', 4, 1, 1, 164, 107, NULL, NULL, '2025-10-15 05:12:34', '2025-10-18 00:32:13'),
