(110, '1759921637.png', 'James Hames', 'CEO, Kazipark 3', 'Alisos artwork captures emotions in a way that words never could. Each piece feels alive  layered with depth, detail, and a sense of calm that draws you in. Their understanding of texture and color harmony makes every creation feel timeless and deeply personal.', 1, 158, 104, '2025-10-08 05:07:17', '2025-10-08 05:07:17', NULL, NULL),
(111, '1759921689.png', 'James Hamaes', 'CEO, EX Car', 'Working with Aliso was an inspiring experience. From the first concept sketch to the final canvas, every step reflected precision and passion. The artwork exceeded my expectations, perfectly blending traditional Japanese aesthetics with a modern touch.', 2, 158, 104, '2025-10-08 05:08:09', '2025-10-08 05:08:09', NULL, NULL),
(112, '1759921713.png', 'Sophia Brown', 'CEO, Kazipark 3', 'Aliso has an incredible gift for transforming simple ideas into powerful visual stories. The balance of expression and structure in their work shows years of dedication and mastery. Its rare to find such emotional honesty captured through art.', 3, 158, 104, '2025-10-08 05:08:33', '2025-10-08 05:08:33', NULL, NULL),
(113, '1759921727.png', 'Carlos Martinez', 'CEO, EX Car', 'Ive collected several pieces from Aliso, and each one brings a unique energy into my space. Their art radiates emotion and tranquility at once  you can feel the artists soul in every brushstroke. Truly a remarkable talent from Tokyo.', 4, 158, 104, '2025-10-08 05:08:47', '2025-10-08 05:08:47', NULL, NULL),
