(119, '1760162701.png', 'Ahmed Al-Farouqi', 'University Professor', 'The telemedicine service saved me a lot of time. I could consult with my specialist without leaving my home. Excellent communication and professionalism throughout.', 2, 160, 105, '2025-10-11 00:05:01', '2025-10-11 00:05:01', NULL, NULL),
(120, '1760162714.png', 'Lisa Chen', 'Graphic Designer', 'I had a smooth experience from registration to diagnosis. The platform is user-friendly, and the doctors advice was precise and helpful. Highly recommend it!', 3, 160, 105, '2025-10-11 00:05:14', '2025-10-11 00:05:14', NULL, NULL),
