(122, '1760162759.png', 'Fatima Noor', 'Entrepreneur', 'I was amazed at how quickly I got connected with a doctor. The consultation was professional and compassionate. This platform truly understands patient needs', 5, 160, 105, '2025-10-11 00:05:59', '2025-10-11 00:05:59', NULL, NULL),
(123, '1760162791.png', 'James Parker', 'Fitness Trainer', 'I use this service regularly for my clients health consultations. Its reliable, fast, and the doctors are always approachable and knowledgeable.', 6, 160, 105, '2025-10-11 00:06:31', '2025-10-11 00:06:31', NULL, NULL),
